import * as React from 'react';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import Dialog from '@mui/material/Dialog';
import DialogActions from '@mui/material/DialogActions';
import DialogContent from '@mui/material/DialogContent';
import DialogTitle from '@mui/material/DialogTitle';
import cryptoData from '../../data';
import CustomSelect from '../drop-zone/CustomSelect';
import { InputLabel, MenuItem, Select } from '@mui/material';

export default function DialogBox(props) {

  const handleSelectChange = (name, value) => {
    props.onChange(name, value);
  };

  return (
    <div>
      <Dialog open={props.open} onClose={props.handleClose}>
        <DialogTitle>Exchange Crypto With</DialogTitle>
        <DialogContent>
          <InputLabel id="label">Select Crypto</InputLabel>
          <Select fullWidth={true} labelId="label" id="select" value="subas">
            {
              cryptoData.map((item, index) => (
                <MenuItem key={index} value="10" >{item.name}</MenuItem>
              ))
            }
          </Select>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Crypto Quantity"
            type="number"
            fullWidth={true}
            variant="standard"
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={props.handleClose}>Cancel</Button>
          <Button onClick={props.handleClose}>Subit</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
